    "2016-02-22T23:31:40.430055",nt"name": "ex1103-exploration-and-mapping-galapagos-spreading-center-mapping-ctd-tow-yo-and-rov-on-noaa-sha0c3c",nt"isopen":
    false,nt"url": null,nt"notes": "This cruise will be composed of two separate
    legs. The first leg will be a transit from San Diego, CA to the Galapagos Spreading
    Center, where multibeam mapping, CTD casts, and CTD tow-yo operations will be performed.
    The ship will have a port call and science party change in Puntarenas, Costa Rica
    between July 2 and July 7, 2011. Following this port call, from July 7 - July 28,
    2011, the ROV Little Hercules and camera sled Seirios, will investigate targets
    identified in Leg 1. Further multibeam mapping and CTD casts will also be performed.
    Leg 2 will end at Balboa, Panama.",nt"license_title": null,nt"extras":
